const replaceAll = (str, find, replace) => {
    return str.replace(new RegExp(find, "g"), replace);
}

const arrayReplaceTransposer = arr => {
    let result = [];
    for (let i = 0; i < arr.length; i++) {
        if (!result[arr[i]]) {
            result[arr[i]] = [arr[i]];
        } else {
            result[arr[i]].push(arr[i]);
        }
    }
    for (let j in result) {
        if (j === 'a') continue;
        result[j] = Array(result['a'].length).fill(j);
    }
    return [...result['a'],...result['g'],...result['b']];
};

const transposeArray = arr => {
    const newArr = arrayReplaceTransposer(arr);
    return replaceAll(newArr.join(''), 'g', 'a').split('');
};

